import { useEffect, useState } from 'react';
import {default as Api} from '../utils/Api.js'
function Card(props) {
    const[initialCards,Setuserdata]= useState(0)
    useEffect(()=>{
        Api.getMassCards()
        .then((res)=>{
            console.log(res)
            Setuserdata(res)
        })
    },[])
    console.log(initialCards.name)
    return(
    <section class="elements"> 
       <article class="element"><button class ="element__delete"></button><img class="element__photo" src={initialCards.link ? initialCards.link : 'ошибка'} alt={initialCards.name ? initialCards.name : 'ошибка'} /><div class="element__description"><h2 class="element__header">{initialCards.name ? initialCards.name : 'ошибка'}</h2><div class = "element__like-contaner"><button type="button" class="element__like-button"></button><span class="element__likes-number"></span></div></div></article>  
    </section>

    );
}
export default Card
